window.bookSummaryJSON = "<p><b>Leaving Earth is the easy part. Surviving the trip to a new home 10,000 light years away is a journey like no other.</b></p> <p>Merritt Alder is done with Earth. The planet is polluted and overpopulated, and its people are hungry.</p> <p>Earth's first colony, Galena, is a pioneer world 10,000 light years away. It has clean air, unpolluted water, and continents of arable land. Anyone can start a new life…if they can get there.</p> <p>For Merritt, the journey is only the beginning. Obstacles arise every step of the way, forcing compromise and sacrifice. And not everyone on his ship is pure of heart.</p> <p>The bonds he forges on the journey will be the key to surviving on another world—a world anyone has yet to fully explore.</p> <p>A world with secrets of its own.</p> <p><b><i>Another World</i></b><b> is a bold new entry in the realm of planet colonization and pioneer science fiction, an odyssey across our own galaxy to start a new life on Earth’s first colony.</b></p>"; 
